DELETE FROM `wordpress`.`wp_posts` WHERE `wp_posts`.`post_type` = "post";

DELETE FROM `wordpress`.`wp_terms` WHERE `wp_terms`.`term_id` > 13;

DELETE FROM `wordpress`.`wp_term_taxonomy` WHERE `wp_term_taxonomy`.`term_id` > 15;

DELETE FROM `wordpress`.`wp_term_relationships` WHERE `wp_term_relationships`.`term_taxonomy_id` > 15;

